create table film
(
    id_film           int          not null
        primary key,
    année_sortie_film int          null,
    id_imdb_film      varchar(10)  null,
    langue_film       varchar(20)  null,
    nom_film          varchar(100) null,
    plot_film         longtext     null,
    url_film          varchar(40)  null
)
    engine = MyISAM;

